Step-by-step reasoning:
1. Key psychological mechanisms include fairness‐concerns and self‐interest. When acting as proposer, participants are assumed to have two “options”: a fair offer benchmark computed from the relative token contributions (i.e. the opponent’s tokens relative to the total tokens) and a selfish alternative that minimizes the offer to the opponent. The fairness benchmark is defined as the percentage offer that would equalize contributions, whereas the selfish option is assumed to be lower.
2. These two alternatives compete. The proposer “chooses” between offering the fair benchmark or the selfish option based on the relative utility difference between the two. This choice is modeled as a binary decision: with some probability the proposer offers the fair share and with the complementary probability the proposer offers the selfish share.
3. Mathematically, we capture this via a logistic (sigmoid) function that maps the difference between the fairness benchmark (f_fair) and the selfish option (f_selfish, a free parameter) onto a probability. We define the fairness benchmark on each trial as:
   f_fair = 100·token_opp/(token_self + token_opp)
4. The utility difference is taken as λ (lambda_param) times (f_fair – f_selfish). The logistic function then produces p_fair = 1/(1 + exp(–λ(f_fair – f_selfish))).
5. Finally, the proposer’s predicted offer (proposed_perc) is the expected value over the binary choice: if the fair option is chosen, the offer is f_fair; if the selfish option is chosen, the offer is f_selfish. Thus, the predicted proposal is:
   ProposedPerc = p_fair·f_fair + (1 – p_fair)·f_selfish.
6. The model uses two learnable parameters:
   • lambda_param: the sensitivity to the difference between the fairness benchmark and the selfish option, with generous bounds [0, 10].
   • f_selfish: the offer level when opting for the selfish alternative, with bounds [0, 100].

Below is the formal model specification and the corresponding variable descriptions.

<MODEL>
Predicted_proposed_perc = (1/(1+exp(-lambda_param*(100*token_opp/(token_self+token_opp)-f_selfish))))*(100*token_opp/(token_self+token_opp)) + (1-1/(1+exp(-lambda_param*(100*token_opp/(token_self+token_opp)-f_selfish))))*f_selfish
</MODEL>

